import Button from '@mui/material/Button';
const ProductLSideView = (props) => {
    const data = props.products;
    console.log('data:', data);
    return (
        <>
            <div style={{ border: '1px solid red', paddingLeft: '10px' }}>
                <img src={data.detailUrl} alt="" sizes="" srcset="" />

                <Row>
                    <Col lg={6} md={6} sm={12} xs={12}>
                        <Button
                            style={{
                                backgroundColor: '#f86418',
                            }}
                        >
                            Continue
                        </Button>
                    </Col>
                    <Col lg={6} md={6} sm={12} xs={12}>
                        <Button
                            style={{
                                backgroundColor: '#f86418',
                            }}
                        >
                            Continue
                        </Button>
                    </Col>
                </Row>
            </div>
        </>
    );
};

export default ProductLSideView;
